import React from "react";

function Main() {
  var words = [
      "Hi i like HTML",
      "I also like css",
      "Lorem ipsum dolor sit amet",
      " consectetur adipiscing elit",
      "sed do eiusmod tempor incididunt",
    ],
    part,
    i = 0,
    offset = 0,
    len = words.length,
    forwards = true,
    skip_count = 0,
    skip_delay = 15,
    speed = 70;
  var wordflick = function () {
    setInterval(function () {
      if (forwards) {
        if (offset >= words[i].length) {
          ++skip_count;
          if (skip_count == skip_delay) {
            forwards = false;
            skip_count = 0;
          }
        }
      } else {
        if (offset == 0) {
          forwards = true;
          i++;
          offset = 0;
          if (i >= len) {
            i = 0;
          }
        }
      }
      part = words[i].substr(0, offset);
      if (skip_count == 0) {
        if (forwards) {
          offset++;
        } else {
          offset--;
        }
      }
      document.getElementById("word").text(part);
    }, speed);
  };

  $(document).ready(function () {
    wordflick();
  });

  return (
    <section
      className="site-hero"
      style={{ background: "#808080" }}
      //   style={{ backgroundImage: "url(cdn/images/image_1.jpg)" }}
      id="section-home"
      data-stellar-background-ratio="0.5"
    >
      <div className="container">
        <div className="row intro-text align-items-center justify-content-center">
          <div className="col-md-10 text-center pt-5">
            <div id="word"></div>
            <h1 className="site-heading site-animate">
              Hello, I'm <strong className="d-block">Charles Anderson</strong>
            </h1>
            <strong className="d-block text-white text-uppercase letter-spacing">
              and this is My Rezume
            </strong>
          </div>
        </div>
      </div>
    </section>
  );
}

export default Main;
